import React from "react";
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import NavDropdown from 'react-bootstrap/NavDropdown';
import Container from 'react-bootstrap/Container';
import Image from 'react-bootstrap/Image'; // Importando o componente Image

function MyNavbar() {
  return (
    <Navbar expand="lg" className="bg-body-tertiary">
      <Container>
        <Navbar.Brand href="#home">Curriculo</Navbar.Brand>
        <Navbar.Toggle aria-controls="basic-navbar-nav" />
        <Navbar.Collapse id="basic-navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Cadastrar currículo</Nav.Link>
            <Nav.Link href="#link">Exibir currículo</Nav.Link>
          </Nav>
          {/* Adicionando a imagem no canto direito */}
          <Image
            src="https://via.placeholder.com/40" // Substitua pela URL da sua imagem
            roundedCircle // Estilo de borda arredondada
            className="ml-auto" // A classe 'ml-auto' vai empurrar a imagem para o lado direito
          />
        </Navbar.Collapse>
      </Container>
    </Navbar>
  );
}

export default MyNavbar;
